webpackJsonp([0x869cdc21fa65],{4285:function(a,l){a.exports={data:{markdownRemark:{html:'<p>都内で仕事中でしたが、ホンキで死を覚悟したのは7年前に単車で事故った時以来、生まれて2度目ですね。\n墨田区の自宅まで 7 時間徒歩で帰宅した後、無茶苦茶になった家具を片付けて(天袋の荷物が全部床に落ちてた)、本当に散々でした。\n実家もここよりは東北よりなうえに築 50 年以上のおかぐら増築なのでヤバいんじゃね？\nと思ったら、「大黒柱が曲がった程度で済んだ」と……いやそれはヤバいの範疇に入るだろｊｋ</p>\n<p>いずれにしても都内と首都圏近郊でコレだから向こうはもっとやばいんだろうなぁ、と実感しましたね。\ndanmaq は被災者の方々の無事をお祈りするとともに、ほんの些細な笑い、暇つぶし、あるいは夜のオカズとなるようなデジタルコンテンツを提供できたら、と思っています。<br>\nあ、ゲームだけは夏まで待ってほしいんだ。</p>\n<h2>習作・待ち受けFlash</h2>\n<p>仕事で FlashCS + AS3 使ったアプリ作るよ！ってことになったものの、生憎未経験だったので慌てて習作として<a href="/lifegame.html">ライフゲームを作ってみたテスト</a>。\nいや最近ボカロとちょっとだけまどかに浮気気味で、このサイトから東方っ気が抜けてきちゃってるからえーりんつながりで、ね。</p>\n<p>厳密には Flash 自体はやったことあるんですよ。\nただ Flash CS でやったことあるのは Flash Lite 1.1 (PC 版 Flash でいうところの 4 相当) だけで、それ以降は全部 Flex Builder 使ってたんですよ。</p>\n<p>最初 Flex のときとあまりの違いに発狂しかけましたが、リンケージの使い方さえ覚えたらあとは楽ですね。</p>\n<ul>\n<li><a href="/lifegame.html">プレビュー</a>(Flash Lite2.0以降またはFlash Player8以降)</li>\n<li><a href="/filez/app/lifegame.zip">Flashムービー本体とFlashCS4プロジェクトとソース(凄いスパゲティだよ！)をダウンロード</a></li>\n</ul>\n<h2>今週のToLOVEるに物申す</h2>\n<p>猛烈に今更ながらジャンプスクエアを立ち読み。  </p>\n<p>矢吹神ついにやってくださいましたか！\nそれに引き換え、絵が描ける癖に己の性癖に正直な絵を、少なくともここ13年は一度も描いたことのない俺ときたら……俺ときたら……<a href="../04/01-be-honest-to-oneself.md">次回へ続く</a>！</p>',frontmatter:{cover:null,date:"2011-03-15T00:00:00+09:00",strDate:"2011/3/14",title:"生きてます"}}},pathContext:{path:"/ja/blog/2011/03/15-i-am-alive/",langKey:"ja"}}}});
